import {  Input ,Button} from 'antd';
import React from 'react';
import 'antd/dist/antd.css';
import { observable } from 'mobx';


const { Search } = Input;
@inject('store')
@observable
class SearchSet extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      value:""
    }
  }

  render(){
    const {value} = this.state;
    const {store} = this.props;
    const {handleSearchIn,handleChange,handleResetson} = store;
    return(
      <div>
      <Search
        placeholder="input search text"
        enterButton="Search"
        size="large"
        onSearch={value => handleSearchIn(value)}
        onChange={e => handleChange(e)}
        style={{margin:20 ,width:"30%" }}
        value={value}
      />
      <Button onClick={handleResetson} style={{ width:90}} style={{margin:20}}>
       Reset
      </Button>
    </div>
    )
  }

}

export default SearchSet
